SELECT On_Time_On_Time_Performance_2016_1.Div2LongestGTime, On_Time_On_Time_Performance_2016_1.AirTime, ROW_NUMBER() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.OriginAirportSeqID ORDER BY On_Time_On_Time_Performance_2016_1.DivAirportLandings) AS win_2, RANK() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.CRSDepTime ORDER BY On_Time_On_Time_Performance_2016_1.CancellationCode) AS win_3, SUM(On_Time_On_Time_Performance_2016_1.AirlineID) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.DestStateFips ORDER BY On_Time_On_Time_Performance_2016_1.DepDel15) AS win_4 FROM On_Time_On_Time_Performance_2016_1